    "lpc-pronouns-ui.PronounsStrings.header.error": "Не вдалося зберегти зміни",
    "lpc-pronouns-ui.PronounsStrings.header.errorSubtitle": "Сталася помилка. Не вдалося зберегти зміни. Повернутися, щоб спробувати ще раз?",
    "lpc-pronouns-ui.PronounsStrings.header.info": "Будь-який користувач, який має обліковий запис на роботі або в навчальному закладі, включно з гостьовими обліковими записами, може бачити ваші займенники.",
    "lpc-pronouns-ui.PronounsStrings.input.ariaFirstSuggestion": "Вони/їх/їм, наприклад, один із трьох",
