    "lpc-pronouns-ui.PronounsStrings.input.firstSuggestion": "Вони/їх",
    "lpc-pronouns-ui.PronounsStrings.input.maxlengthInputError": "Займенник має містити не більше ніж стільки символів (включно з пробілами): {0}",
    "lpc-pronouns-ui.PronounsStrings.input.secondSuggestion": "Вона/її",
    "lpc-pronouns-ui.PronounsStrings.input.suggestion": "Варіанти:",
    "lpc-pronouns-ui.PronounsStrings.input.thirdSuggestion": "Він/його",
    "lpc-pronouns-ui.PronounsStrings.learnMore.firstPageFirstParagraphText": "Займенники — це слова, якими ми заміняємо імена людей у реченнях, наприклад \"він\", \"вона\" або \"вони\" в українській мові. Поле займенників необов’язкове, але в ньому ви можете вказати, які займенники можна використовувати, звертаючись до вас.",
    "lpc-pronouns-ui.PronounsStrings.learnMore.firstPageSecondParagraphText": "Уживання правильних займенників вказує на те, наскільки ми цінуємо іклюзивність і поважаємо наших користувачів. Вказуючи свої займенники під час знайомства або в профілі, ви допомагаєте нам створити толерантне середовище й заохочуєте до цього інших людей.",
    "lpc-pronouns-ui.PronounsStrings.learnMore.firstPageTitle": "Займенники у профілі",
    "lpc-pronouns-ui.PronounsStrings.learnMore.learnMoreAltText": "Зображення \"Докладніше\"",
    "lpc-pronouns-ui.PronounsStrings.learnMore.secondPageFirstParagraphText": "Важливим є те, що гендерну ідентичність осіб і займенники, які можна вживати до них, не можна визначати лише на основі початкових спостережень. Коли до нас звертаються, використовуючи неправильні займенники, ми можемо відчути зневагу й невизнання. Дізнаючись, які займенники слід використовувати, ми показуємо, що цінуємо інклюзивність і уважність. Приділіть час, щоб довідатися, за допомогою яких займенників звертатися до когось, або попрактикуватись із займенниками, яких ви не знаєте.",
    "lpc-pronouns-ui.PronounsStrings.learnMore.secondPageSecondParagraphText": "Пам’ятайте, що займенники – це частина ідентичності людини й те, як ми самовиражаємося. Кожна людина сама може вирішувати, чи показувати в профілі свої займенники.",
    "lpc-pronouns-ui.PronounsStrings.learnMore.secondPageTitle": "Не робіть припущень",
